/** @format */

// StockResults.js
import React from "react";
import { useSelector } from "react-redux";
import TableComponent from "../TableComponent/TableComponent";

const StockResults = () => {
  const stockData = useSelector((state) => state.stockData);

  console.log(stockData);

  const tableData = [
    [
      "Price",
      stockData?.price?.max || "",
      stockData?.price?.min || "",
      stockData?.price?.average || "",
    ],
    [
      "Volume",
      stockData?.volume?.max || "",
      stockData?.volume?.min || "",
      stockData?.volume?.average || "",
    ],
  ];

  return (
    <div>
      <TableComponent data={tableData} />
      {/* Display stock results based on stockData */}
      {/* You can extract and display average price, max/min volume, max/min stock price */}
    </div>
  );
};

export default StockResults;
